import classes from '../styles/Header.module.css';
import coverImage from '../images/meals.jpg';

export const Header = () => {
    return (
        <>
        <div className={classes.header}>
            Rock & Meals
        <img src={coverImage} alt="coverImage" className={classes.main}/>   
        </div>
        </>
    )
}
